import React from 'react';
import SuitableItem from './SuitableItem';

const Suitable = () => {
  return (
    <div className="wrapper suitable">
      <h2 className="suitable__title second__title">Кому подходит?</h2>
      <div className="suitable__container">
        <SuitableItem imgSrc="img/suitable.svg" description="Тем, у&nbsp;кого есть&nbsp;бизнес-идея в&nbsp;сфере affiliate-маркетинга, способная потенциально генерировать более 50&nbsp;000&nbsp;$ в&nbsp;месяц" delay={500} />
        <SuitableItem imgSrc="img/suitable.svg" description="Опытным медиабайерам и&nbsp;тимлидам, желающим создать своё медиабаинговое агентство (арбитражную команду)" delay={1000} />
        <SuitableItem imgSrc="img/suitable.svg" description="Тем, кто&nbsp;имеет продуктовый и&nbsp;медиабаинговый бэкграуд и&nbsp;желание развиваться в&nbsp;сфере, a&nbsp;также&nbsp;нацелен на&nbsp;долгосрочные проекты" delay={1500} />
      </div>
    </div>
  );
};
